import React from "react";
import { Link } from "react-router-dom";

// styles
import mainNavStyle from "./MainNavigation.module.css";

const MainNavigaion = () => {
  return (
    <header className={mainNavStyle.header}>
      <h1>React App</h1>
      <nav>
        <ul className={mainNavStyle.navList}>
          <li>
            <Link className={mainNavStyle.link} to={"/"}>
              Home
            </Link>
          </li>
          <li>
            <Link className={mainNavStyle.link} to={"/products"}>
              Products
            </Link>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default MainNavigaion;
